  ThemeProvider,
  createMuiTheme,
} from '@material-ui/core/styles';
import axios from 'axios';


const AntSwitch = withStyles(theme => ({
  root: {
    width: 28,
    height: 16,
    padding: 0,
    display: 'flex',
  },
  switchBase: {
    padding: 2,
    color: theme.palette.grey[500],
    '&$checked': {
      transform: 'translateX(12px)',
      color: theme.palette.common.white,
      '& + $track': {
        opacity: 1,
        backgroundColor: theme.palette.primary.main,
        borderColor: theme.palette.primary.main,
      },
    },
  },
  thumb: {
    width: 12,
    height: 12,
    boxShadow: 'none',
  },
  track: {
    border: `1px solid ${theme.palette.grey[500]}`,
    borderRadius: 16 / 2,
    opacity: 1,
    backgroundColor: theme.palette.common.white,
  },
  checked: {},
}))(Switch);

const theme = createMuiTheme({
  palette: {
    primary: green,
  },
});


class EditProfile extends React.Component{


  constructor(props) {
    super(props);
    this.state = {
      user: {
        name: '',
        username: '',
        bio:'',
        email:'',
        image:'',  
      },
      interest: {
        skills:'',

      }
      }
    }

componentDidMount = () => {
  this.getUserData();
  this.getInterestData(); 

}
getUserData = () => {
  axios.get('https://energeapi.do.viewyoursite.net/', {
     //headers: {
     //  Authorization: 'Bearer ' + JSON.parse(localStorage.getItem('access'))
     //}
  }).then(res => {
    const user = this.state.user
    user.name = res.data.first_name+' '+res.data.last_name 
    user.username = res.data.username
    user.bio = res.data.about
    user.email = res.data.email
    user.skills = 'skill set' 
    // res.data.skills
    user.image = res.data.avatar
    this.setState({ user });
  });
}

getInterestData = () => {
  var url = "https://energeapi.do.viewyoursite.net/user/interest/2/";
  var getToken = localStorage.getItem('access');
  axios.get(
    url,
    {
        headers: {
            Authorization: 'Bearer ' + getToken,
        }
    }).then(res => {
    const interest = this.state.interest
    interest.skills = res.data.first_name+' '+res.data.last_name 

    this.setState({ interest });
  });
}
